import React from 'react';
import Button from './Button';
import './Navbar.css';
import './Button';
import Logo from '/Users/michaelabamfo/movies-app/src/images/moviechomp.png'
const Navbar = () => {
    return (
        <div className='navBar'>
          <div className='navBarRight'>  
          <div>
             <a href='#'> <img  style={{padding:'0', margin:'0', width:'100px', height:'100px', boxSizing:'border-box'}}src={Logo} /> </a> 
         </div>
              <ul>
             <li><a href='#'>Home</a></li> 
              <li><a href='#'>Movie</a></li>
              <li><a href='#'>FAQ</a></li>
              <li><a href='#'><Button /></a></li>
              </ul>
          </div>

        </div>

    )
}
export default Navbar
